import { useLocation } from "react-router";

const Footer = () => {
  const location = useLocation();
  if (location.pathname !== "/") {
    return (
      <footer>
        <div className="container">
          <div className=" py-2 me-0">Copyright &copy; CAR RENTAL</div>
        </div>
      </footer>
    );
  } else return null;
};

export default Footer;
